                            <th>Address</th>
                            <th>Gender</th>

                        </tr>
                    </thead>
                    <tbody>
                        {
                            // this.state.users.map( user =>
                            //         <tr key={user.id}>
                            //             <td>{user.id}</td>
                            //             <td>{user.name}</td>
                            //             <td>{user.address}</td>
                            //             <td>{user.gender}</td>

                            //             <td>

                            //             </td>
                            //         </tr>
                            // )
                            this.state.users
                        }
                    </tbody>
                </table>

            </div>
        );
    }

}

export default ListUsers;
